Trocou o técnico, de novo, mas o marasmo continua.
 1-Bruno Henrique parece um desembestado, renovou encheu bolso de dinheiro e desaprendeu a jogar bola;
2-O Pedro parece uma barata tonta, ninguém cruza bola para ele;
3-Ninguem sabe chutar de fora da área; 
